DROP TABLE IF EXISTS "dinners";
CREATE TABLE "dinners" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "date" datetime, "location" varchar(255), "title" varchar(255), "description" text(255), "category" varchar(255), "price" float, "seats_available" integer, "stamp" datetime, "created_at" datetime, "updated_at" datetime, "photo" varchar(255));
DROP TABLE IF EXISTS "schema_migrations";
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
